import React from "react";
import { Typography, Button, ThemeProvider } from "@mui/material";
import { createTheme } from "@mui/material";
import PhoneIcon from "@mui/icons-material/Phone";

// const theme = createTheme({
//   palette: {
//     primary: "purple",
//   },
// });

function Navbar(props) {
  return (
    <div>
      <header className="header">
        <div style={{ marginLeft: 60 }}>
          <img
            src="https://idreamcareer.com/wp-content/uploads/2021/08/small-logo-1.webp"
            height="50px"
            width="80px"
          />
        </div>
        <div className="h2">
          <div className="h1">
            <Typography style={{ color: "blue", textDecoration: "underline" }}>
              Home
            </Typography>
          </div>
          <div className="h1">
            <Typography>9th-10th</Typography>
          </div>
          <div className="h1">
            <Typography>11th-12th</Typography>
          </div>
          <div className="h1">
            <Typography>Undergraduate</Typography>
          </div>
          <div className="h1">
            <Typography>Study Abroad</Typography>
          </div>
          <div className="h1">
            <Typography>Blog</Typography>
          </div>
          <div className="h1">
            <PhoneIcon />
          </div>
          <div style={{ margin: 15 }}>
            <Button
              variant="contained"
              size="large"
              style={{
                backgroundColor: "#4c9fec",
                color: "white",
                padding: 5,
              }}
            >
              Book Now
            </Button>
          </div>
        </div>
      </header>
    </div>
  );
}

export default Navbar;
